import React, { Component } from "react";

class File extends Component{
    hello(){
        return <h3></h3>
    
    }

    render (){
        const names=["ayman","ahmed"]
        const h=this.hello()
        
   const S=names.map(function(e){
            return <h1>{h} {e}</h1>
        })
        
       
        return(
            S
        )
    }
}

export default File
